import React from "react";

function Jumbotron() {
    return (
        <div>
        <div N="jumbotron jumbotron-fluid">
            <div N="container">
                <h1 N="display-4">Fluid jumbotron</h1>
                <p N="lead">This is a modified jumbotron that occupies the entire horizontal space of its parent.</p>
            </div>
        </div>
        </div>
    );
};

export default Jumbotron;
